import React from "react";
import "../assets/css/style_login.css";
// import MenuLogin from "../components/MenuLogin";
// import MenuLogin from "../components/MenuLogin";


function Index() {
    return (
        <>
        <div class="showcase-login">


        <div class="conteiner-login">

            <div class="logo-login">
                <img src="images/Login/logo.png" alt="" width="65%"></img>
            </div>

            <div class="menu-login">

                <a href="/#">Home</a>
                <a href="/#">Sobre nós</a>
                <a href="/#">Contato</a>

            </div>

            <div class="botao-login">

                <button class="botao-cadastro-login"><b>Cadastre-se</b></button>
            </div>


            <header id="header">
                <nav id="nav">
                    <button aria-label="Abrir Menu" id="btn-mobile" aria-haspopup="true" aria-controls="menu"
                        aria-expanded="false">
                        <span id="hamburger">
                            <div></div>
                        </span>
                    </button>
                    <ul id="menu" role="menu">
                        <li><a href="/">Home</a></li>
                        <li><a href="/">Sobre nós</a></li>
                        <li><a href="/">Contato</a></li>
                        <li><button class="botao-cadastro-login"><b>Cadastre-se</b></button></li>
                        <li class="line">
                            <div></div>
                        </li>
                        <li class="redesSociais-login">Siga nossas redes sociais</li>
                        <li class="iconesRedesSociais-login">
                            <img src="iconFacebook.png" alt="" width="25px"></img>
                            <img src="iconInstagram.png" alt="" width="30px"></img>
                            <img src="iconYT.png" alt="" width="35px"></img>
                            <img src="iconTwitter.png" alt="" width="37px"></img>
                        </li>
                    </ul>
                </nav>
            </header>

        </div>

        <div class="conteudo-login" id="conteudo">
            <div class="blur-login"></div>
            <div class="imagem-principal-login">

                <h3>
                    <p>Entre na sua conta e</p> divulgue seus eventos.
                </h3>
            </div>
            <div class="credencial-login">
                <input type="text" placeholder="Usuário ou email" required></input>
                <br></br>
                <input type="text" placeholder="Senha" required></input>
                <p class="texto-mostrarSenha-login">Mostrar a senha</p>
                <br></br>
                <button>Login</button>
                <p class="texto-maisOpcoes-login">ou continue com</p>
                <div class="maisOpcoes">
                    <div class="opcaoApple"><img src="Images/Login/apple.png" alt="" width="40%"></img></div>
                    <div class="opcaoGoogle"><img src="Images/Login/Google.png" alt="" width="40%"></img></div>
                    <div class="opcaoFace"><img src="Images/Login/face.png" alt="" width="20%"></img></div>
                </div>
                <h4 class="texto-esqueceuSenha"><a href="#">Esqueceu sua senha?</a></h4>
            </div>

        </div>



    </div>





</>





        // <div className="showcase">
